import { useState } from "react";
import FileUpload from "../components/FileUpload";
import FileList from "../components/FileList";
import Analysis from "../components/Analysis";
import { parseFile, getAnalysis } from "../api";

const Home = () => {
  const [uploadedFiles, setUploadedFiles] = useState([]);
  const [analysis, setAnalysis] = useState(null);

  const handleUploadSuccess = (file) => {
    setUploadedFiles([...uploadedFiles, file]);
  };

  const handleParse = async (fileId) => {
    await parseFile(fileId);
    const analysisData = await getAnalysis(fileId);
    setAnalysis(analysisData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <h1 className="text-xl font-bold">File Processing App</h1>
      <FileUpload onUploadSuccess={handleUploadSuccess} />
      <FileList files={uploadedFiles} onParse={handleParse} />
      {analysis && <Analysis analysis={analysis} />}
    </div>
  );
};

export default Home;
